    false,nt"url": null,nt"notes": "The primary objectives of the waterfowl
    studies, done in conjunction with the overall ecological investigation of Back Bay,
    Virginia, and Currituck Sound, North Carolina, from 1958 to 1964, were to document
    the magnitude and nature of the reported decline in waterfowl use, the present waterfowluse,
    the trends in waterfowl harvest, the factors affecting waterfowl use of the area,
    and,to estimate the potential carrying capacity of the area. The data were obtained
    by literature and report review, periodic waterfowl inventories, compiling hunting
    club records of waterfowl kill, food habits studies, and the vegetation studies
    reported on in Volume 1 of this basic data report. Also all waterfowl band recoveries
    through 1961 were compiled and mapped.",nt"license_title": "License Not Specified",nt"extras":
